class Solution {
    public boolean canMakeSubsequence(String str1, String str2) {
        int[] nextChar = new int[str1.length()];
        for (int i = 0; i < str1.length(); i++) {
            nextChar[i] = (str1.charAt(i) - 'a' + 1) % 26 + 'a';
        }

        int i = 0, j = 0;
        while (i < str1.length() && j < str2.length()) {
            if (str1.charAt(i) == str2.charAt(j)) {
                j++;
            } else if (nextChar[i] == str2.charAt(j)) {
                return false; // Since we need to increment more than once or at different places
            }
            i++;
        }
        if (j == str2.length()) return true;

        // Trying with one increment operation anywhere in str1
        for (i = 0; i < str1.length(); i++) {
            int k = 0, l = 0;
            while (k < str1.length() && l < str2.length()) {
                if (k == i) {
                    if (nextChar[k] == str2.charAt(l)) {
                        l++;
                    }
                } else if (str1.charAt(k) == str2.charAt(l)) {
                    l++;
                }
                k++;
            }
            if (l == str2.length()) return true;
        }

        return false;
    }
}
